INSERT INTO `wp_posts` VALUES (1,1,'2017-04-17 18:00:09','2017-04-17 15:00:09','Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите её, затем пишите!','Привет, мир!','','trash','open','open','','%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80__trashed','','','2017-04-17 19:58:32','2017-04-17 16:58:32','',0,'http://beta-bevridge.simplyintense.dev/?p=1',0,'post','',1),(2,1,'2017-04-17 18:00:09','2017-04-17 15:00:09','Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\n\n<blockquote>Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\n\n...или так:\n\n<blockquote>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\n\nПерейдите <a href=\"http://beta-bevridge.simplyintense.dev/wp-admin/\">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!','Пример страницы','','publish','closed','open','','sample-page','','','2017-04-17 18:00:09','2017-04-17 15:00:09','',0,'http://beta-bevridge.simplyintense.dev/?page_id=2',0,'page','',0),(3,1,'2017-04-17 18:00:13','0000-00-00 00:00:00','','Черновик','','auto-draft','open','open','','','','','2017-04-17 18:00:13','0000-00-00 00:00:00','',0,'http://beta-bevridge.simplyintense.dev/?p=3',0,'post','',0),(4,1,'2017-04-17 18:00:17','0000-00-00 00:00:00','','Эспрессо','','auto-draft','open','closed','','','','','2017-04-17 18:00:17','0000-00-00 00:00:00','',0,'http://beta-bevridge.simplyintense.dev/wp-content/uploads/2017/04/espresso.jpg',0,'attachment','image/jpeg',0),(5,1,'2017-04-17 18:00:18','0000-00-00 00:00:00','','Сэндвич','','auto-draft','open','closed','','','','','2017-04-17 18:00:18','0000-00-00 00:00:00','',0,'http://beta-bevridge.simplyintense.dev/wp-content/uploads/2017/04/sandwich.jpg',0,'attachment','image/jpeg',0),(6,1,'2017-04-17 18:00:18','0000-00-00 00:00:00','','Кофе','','auto-draft','open','closed','','','','','2017-04-17 18:00:18','0000-00-00 00:00:00','',0,'http://beta-bevridge.simplyintense.dev/wp-content/uploads/2017/04/coffee.jpg',0,'attachment','image/jpeg',0),(7,1,'2017-04-17 18:00:19','0000-00-00 00:00:00','Добро пожаловать на сайт! Это ваша главная страница, которую большинство посетителей увидят, впервые зайдя на ваш сайт.','Главная страница','','auto-draft','closed','closed','','','','','2017-04-17 18:00:19','0000-00-00 00:00:00','',0,'http://beta-bevridge.simplyintense.dev/?page_id=7',0,'page','',0),(8,1,'2017-04-17 18:00:19','0000-00-00 00:00:00','Вы можете быть художником, который желает здесь представить себя и свои работы или представителем бизнеса с описанием миссии.','О нас','','auto-draft','closed','closed','','','','','2017-04-17 18:00:19','0000-00-00 00:00:00','',0,'http://beta-bevridge.simplyintense.dev/?page_id=8',0,'page','',0),(9,1,'2017-04-17 18:00:19','0000-00-00 00:00:00','Это страница с основной контактной информацией, такой как адрес и номер телефона. Вы также можете попробовать добавить форму контактов с помощью плагина.','Контакты','','auto-draft','closed','closed','','','','','2017-04-17 18:00:19','0000-00-00 00:00:00','',0,'http://beta-bevridge.simplyintense.dev/?page_id=9',0,'page','',0),(10,1,'2017-04-17 18:00:19','0000-00-00 00:00:00','','Блог','','auto-draft','closed','closed','','','','','2017-04-17 18:00:19','0000-00-00 00:00:00','',0,'http://beta-bevridge.simplyintense.dev/?page_id=10',0,'page','',0),(11,1,'2017-04-17 18:00:19','0000-00-00 00:00:00','Это пример раздела главной страницы. Разделы домашней страницы могут быть любыми страницами кроме самой главной страницы, включая страницу последних записей блога.','Раздел главной страницы','','auto-draft','closed','closed','','','','','2017-04-17 18:00:19','0000-00-00 00:00:00','',0,'http://beta-bevridge.simplyintense.dev/?page_id=11',0,'page','',0),(12,1,'2017-04-17 18:00:19','0000-00-00 00:00:00','{\n    \"widget_text[2]\": {\n        \"starter_content\": true,\n        \"value\": {\n            \"encoded_serialized_instance\": \"\",\n            \"title\": \"\\u041d\\u0430\\u0439\\u0434\\u0438\\u0442\\u0435 \\u043d\\u0430\\u0441\",\n            \"is_widget_customizer_js_value\": true,\n            \"instance_hash_key\": \"cfee091cdd4f49366e33543233707e64\"\n        },\n        \"type\": \"option\",\n        \"user_id\": 1\n    },\n    \"widget_search[3]\": {\n        \"starter_content\": true,\n        \"value\": {\n            \"encoded_serialized_instance\": \"YToxOntzOjU6InRpdGxlIjtzOjEwOiLQn9C+0LjRgdC6Ijt9\",\n            \"title\": \"\\u041f\\u043e\\u0438\\u0441\\u043a\",\n            \"is_widget_customizer_js_value\": true,\n            \"instance_hash_key\": \"c283ff5356122e4ff55f549337241a83\"\n        },\n        \"type\": \"option\",\n        \"user_id\": 1\n    },\n    \"widget_text[3]\": {\n        \"starter_content\": true,\n        \"value\": {\n            \"encoded_serialized_instance\": \"\",\n            \"title\": \"\\u041e \\u0441\\u0430\\u0439\\u0442\\u0435\",\n            \"is_widget_customizer_js_value\": true,\n            \"instance_hash_key\": \"25e7795b9f1b9cd3c97aae57f16969c9\"\n        },\n        \"type\": \"option\",\n        \"user_id\": 1\n    },\n    \"sidebars_widgets[sidebar-1]\": {\n        \"starter_content\": true,\n        \"value\": [\n            \"text-2\",\n            \"search-3\",\n            \"text-3\"\n        ],\n        \"type\": \"option\",\n        \"user_id\": 1\n    },\n    \"widget_text[4]\": {\n        \"starter_content\": true,\n        \"value\": {\n            \"encoded_serialized_instance\": \"\",\n            \"title\": \"\\u041d\\u04